            max: try FfiConverterUInt64.read(from: &buf)
            )
        case 6: return .InvoiceCreationFailed(
            errorDetails: try FfiConverterString.read(from: &buf)
            )

         default: throw UniffiInternalError.unexpectedEnumCase
        }
    }

